# VVI
from typing import  List
from collections import defaultdict
class Solution:
    def findAnagrams(self, s: str, p: str) -> List[int]:
        
        # lenP=len(p)
        # lenS=len(s)
        # lst=[]
        # maxRange=min(lenS,lenS-lenP+1)
        # for i in range(maxRange):
        #     endPoint=min(lenP,(lenS-i))
        #     if Counter(s[i:i+endPoint])==Counter(p):
        #         lst.append(i)

        # return lst

        lenP,lenS= len(p),len(s)
        pDict=defaultdict(lambda: 0)
        for let in p: pDict[let]+=1
        sDict=defaultdict(lambda:0)
        for let in s[:lenP-1]: sDict[let]+=1
        lst=[]
        maxRange=min(lenS,lenS-lenP+1)
        for i in range(maxRange):
            endPoint=min(lenP,(lenS-i))-1
            sDict[s[i+endPoint]]+=1

            if sDict==pDict: lst.append(i)
            sDict[s[i]]-=1

            if sDict[s[i]]==0: del sDict[s[i]]
        return lst



        
if __name__=="__main__":
    s = ""
    p = ""
    s="abacbabc"
    p="abc"
    print(Solution().findAnagrams(s=s,p=p))
